from typing import collections, List
class Solution:
    def checkInclusion(self, s1: str, s2: str) -> bool:
        if(len(s1) > len(s2)):
            return False

        ss = set()
        for i in range(0, len(s2) - len(s1) + 1):
            ss.add(s2[i : i + len(s1)])

        s1C = collections.Counter(s1)
        for s in ss:
            tmp = collections.Counter(s)
            if(tmp == s1C):
                return True
        
        return False




print(Solution().checkInclusion("", ""))


